import React, { useContext } from 'react'
import { AuthContext } from '../../../context/AuthContext';
import useFrontendContext from '../../../hooks/useFrontendContext';
import resourcelink from '../../../hooks/resourcelink';

function WishList({product,index}) {
    // const { checkAuth } = useContext(AuthContext);
    // const { dispatch } = useFrontendContext();

   
    // const { totla_cards_amount } = state;
    return (
        <>
            <table border='1' className='table table-responsive'>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>price</th>
                        <th>discount</th>
                        <th>discount Price</th>
                        <th>valid date</th>
                        <th>Product Image</th>
                    </tr>
                </thead>
                <tbody>
                     <tr>
                                    <td></td>
                                    <td>{product.title}</td>
                                    <td>{product.price}</td>
                                    <td>{product.discount}</td>
                                    <td>{product.discount_price}</td>
                                    <td>{product.discount_date}</td>
                                    <td>
                                        <a className="product-image" href="#">
                                            <img src={resourcelink(product.thumb_image)} alt="Simul dolorem voluptaria"  style={{ width: '50px' }}/>
                                        </a>
                                    </td>

                    </tr>
                </tbody>

            </table>
        </>
    )
}

export default WishList
